import React, { Component } from 'react';
import API from '../../backend/API';

class Home extends Component{
  state = {
    usage: []
  };

  componentDidMount(){
    // API.get('/usage').then(result =>
    //   this.setState(() => ({
    //     usage: result
    //   }))
    // );
    API.get({url: '/usage'}).then(result => console.log(result));
  }

  render(){
    return(
      <div>
        <h3>Home View</h3>
      </div>
    )
  }
};

export default Home;
